import bag from './img/bag.svg'


function Nav() {
    return (
        <div className="nav">
            <div className='nav_left'>
                <ul style={{}}>
                    <li>SHOP</li>
                    <li>ESSENTIALS HOLIDAY 2020</li>
                </ul>
            </div>
            <div className='logo'><Link to='/'>ESSENTIALS</Link></div>
            <div className='nav_right'>
                <ul>
                    <li>
                    <Link to='/login'><img width="" src={person} alt="" /></Link>    
                    </li>
                </ul>
                {/* <Link to='/login'><img width="" src={person} alt="" /></Link> */}

                {/* <Link to='/cart'> <img width="" src={bag} alt="" /></Link> */}


            </div>
        </div>
    );
}

export default Nav;
